import React from "react";

const Navbar = () => {
  return (
    <nav className="fixed z-50 w-full py-4 bg-white shadow-md">
      <div className="container flex items-center justify-between px-6 mx-auto">
        <h1 className="text-2xl font-bold text-blue-600">KALKULATOR ROI</h1>
        <ul className="flex space-x-6 text-gray-700">
          <li><a href="#kalkulator" className="hover:text-blue-600">Kalkulator</a></li>
          <li><a href="#tentang" className="hover:text-blue-600">Tentang</a></li>
          <li><a href="#faq" className="hover:text-blue-600">FAQ</a></li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
